import React from "react";
import { Task } from "../../types/index";
import { TodoTask } from "../TodoTask";

interface todoArray {
  todo: Task[];
  onCheck: (id: number) => Task[];
  onDelete: (id: number) => void;
  onEdidt: (id: number, title: string) => void;
}
export const TodoList = ({ todo, onCheck, onDelete, onEdidt }: todoArray) => {
  return (
    <div className="item_list">
      {todo.map((item: Task, index: number) => (
        <TodoTask
          key={index}
          item={item}
          onCheck={onCheck}
          onDelete={onDelete}
          onEdidt={onEdidt}
        />
      ))}
    </div>
  );
};
